/** Immediately switch to a different input stream.
 * @param input_file A readable stream.
 * 
 * @note This function does not reset the start condition to @c INITIAL .
 */
    void NFSv3yyrestart  (FILE * input_file )
{
    
	if ( ! YY_CURRENT_BUFFER ){
        NFSv3yyensure_buffer_stack ();
		YY_CURRENT_BUFFER_LVALUE =
            NFSv3yy_create_buffer(NFSv3yyin,YY_BUF_SIZE );
	}

	NFSv3yy_init_buffer(YY_CURRENT_BUFFER,input_file );
	NFSv3yy_load_buffer_state( );
}

/** Switch to a different input buffer.
 * @param new_buffer The new input buffer.
 * 
 */
    void NFSv3yy_switch_to_buffer  (YY_BUFFER_STATE  new_buffer )
{
    
	/* TODO. We should be able to replace this entire function body
	 * with
	 *		NFSv3yypop_buffer_state();
	 *		NFSv3yypush_buffer_state(new_buffer);
     */
	NFSv3yyensure_buffer_stack ();
	if ( YY_CURRENT_BUFFER == new_buffer )
		return;

	if ( YY_CURRENT_BUFFER )
		{
		/* Flush out information for old buffer. */
		*(NFSv3yy_c_buf_p) = (NFSv3yy_hold_char);
		YY_CURRENT_BUFFER_LVALUE->NFSv3yy_buf_pos = (NFSv3yy_c_buf_p);
		YY_CURRENT_BUFFER_LVALUE->NFSv3yy_n_chars = (NFSv3yy_n_chars);
		}

	YY_CURRENT_BUFFER_LVALUE = new_buffer;
	NFSv3yy_load_buffer_state( );

	/* We don't actually know whether we did this switch during
	 * EOF (NFSv3yywrap()) processing, but the only time this flag
	 * is looked at is after NFSv3yywrap() is called, so it's safe
	 * to go ahead and always set it.
	 */
	(NFSv3yy_did_buffer_switch_on_eof) = 1;
}

static void NFSv3yy_load_buffer_state  (void)
{
    	(NFSv3yy_n_chars) = YY_CURRENT_BUFFER_LVALUE->NFSv3yy_n_chars;
	(NFSv3yytext_ptr) = (NFSv3yy_c_buf_p) = YY_CURRENT_BUFFER_LVALUE->NFSv3yy_buf_pos;
	NFSv3yyin = YY_CURRENT_BUFFER_LVALUE->NFSv3yy_input_file;
	(NFSv3yy_hold_char) = *(NFSv3yy_c_buf_p);
}

/** Allocate and initialize an input buffer state.
 * @param file A readable stream.
 * @param size The character buffer size in bytes. When in doubt, use @c YY_BUF_SIZE.
 * 
 * @return the allocated buffer state.
 */
    YY_BUFFER_STATE NFSv3yy_create_buffer  (FILE * file, int  size )
{
	YY_BUFFER_STATE b;
    
	b = (YY_BUFFER_STATE) NFSv3yyalloc(sizeof( struct NFSv3yy_buffer_state )  );
	if ( ! b )
		YY_FATAL_ERROR( "out of dynamic memory in NFSv3yy_create_buffer()" );

	b->NFSv3yy_buf_size = size;

	/* NFSv3yy_ch_buf has to be 2 characters longer than the size given because
	 * we need to put in 2 end-of-buffer characters.
	 */
	b->NFSv3yy_ch_buf = (char *) NFSv3yyalloc(b->NFSv3yy_buf_size + 2  );
	if ( ! b->NFSv3yy_ch_buf )
		YY_FATAL_ERROR( "out of dynamic memory in NFSv3yy_create_buffer()" );

	b->NFSv3yy_is_our_buffer = 1;

	NFSv3yy_init_buffer(b,file );

	return b;
}

/** Destroy the buffer.
 * @param b a buffer created with NFSv3yy_create_buffer()
 * 
 */
