/* Initializes or reinitializes a buffer.
 * This function is sometimes called more than once on the same buffer,
 * such as during a NFSv3yyrestart() or at EOF.
 */
    static void NFSv3yy_init_buffer  (YY_BUFFER_STATE  b, FILE * file )

{
	int oerrno = errno;
    
	NFSv3yy_flush_buffer(b );

	b->NFSv3yy_input_file = file;
	b->NFSv3yy_fill_buffer = 1;

    /* If b is the current buffer, then NFSv3yy_init_buffer was _probably_
     * called from NFSv3yyrestart() or through NFSv3yy_get_next_buffer.
     * In that case, we don't want to reset the lineno or column.
     */
    if (b != YY_CURRENT_BUFFER){
        b->NFSv3yy_bs_lineno = 1;
        b->NFSv3yy_bs_column = 0;
    }

        b->NFSv3yy_is_interactive = file ? (isatty( fileno(file) ) > 0) : 0;
    
	errno = oerrno;
}

/** Discard all buffered characters. On the next scan, YY_INPUT will be called.
 * @param b the buffer state to be flushed, usually @c YY_CURRENT_BUFFER.
 * 
 */
    void NFSv3yy_flush_buffer (YY_BUFFER_STATE  b )
{
    	if ( ! b )
		return;

	b->NFSv3yy_n_chars = 0;

	/* We always need two end-of-buffer characters.  The first causes
	 * a transition to the end-of-buffer state.  The second causes
	 * a jam in that state.
	 */
	b->NFSv3yy_ch_buf[0] = YY_END_OF_BUFFER_CHAR;
	b->NFSv3yy_ch_buf[1] = YY_END_OF_BUFFER_CHAR;

	b->NFSv3yy_buf_pos = &b->NFSv3yy_ch_buf[0];

	b->NFSv3yy_at_bol = 1;
	b->NFSv3yy_buffer_status = YY_BUFFER_NEW;

	if ( b == YY_CURRENT_BUFFER )
		NFSv3yy_load_buffer_state( );
}

/** Pushes the new state onto the stack. The new state becomes
 *  the current state. This function will allocate the stack
 *  if necessary.
 *  @param new_buffer The new state.
 *  
 */
void NFSv3yypush_buffer_state (YY_BUFFER_STATE new_buffer )
{
    	if (new_buffer == NULL)
		return;

	NFSv3yyensure_buffer_stack();

	/* This block is copied from NFSv3yy_switch_to_buffer. */
	if ( YY_CURRENT_BUFFER )
		{
		/* Flush out information for old buffer. */
		*(NFSv3yy_c_buf_p) = (NFSv3yy_hold_char);
		YY_CURRENT_BUFFER_LVALUE->NFSv3yy_buf_pos = (NFSv3yy_c_buf_p);
		YY_CURRENT_BUFFER_LVALUE->NFSv3yy_n_chars = (NFSv3yy_n_chars);
		}

	/* Only push if top exists. Otherwise, replace top. */
	if (YY_CURRENT_BUFFER)
		(NFSv3yy_buffer_stack_top)++;
	YY_CURRENT_BUFFER_LVALUE = new_buffer;

	/* copied from NFSv3yy_switch_to_buffer. */
	NFSv3yy_load_buffer_state( );
	(NFSv3yy_did_buffer_switch_on_eof) = 1;
}

/** Removes and deletes the top of the stack, if present.
 *  The next element becomes the new top.
 *  
 */
void NFSv3yypop_buffer_state (void)
{
    	if (!YY_CURRENT_BUFFER)
		return;

	NFSv3yy_delete_buffer(YY_CURRENT_BUFFER );
	YY_CURRENT_BUFFER_LVALUE = NULL;
	if ((NFSv3yy_buffer_stack_top) > 0)
		--(NFSv3yy_buffer_stack_top);

	if (YY_CURRENT_BUFFER) {
		NFSv3yy_load_buffer_state( );
		(NFSv3yy_did_buffer_switch_on_eof) = 1;
	}
}

/* Allocates the stack if it does not exist.
 *  Guarantees space for at least one push.
 */
static void NFSv3yyensure_buffer_stack (void)
{
	int num_to_alloc;
    
	if (!(NFSv3yy_buffer_stack)) {

		/* First allocation is just for 2 elements, since we don't know if this
		 * scanner will even need a stack. We use 2 instead of 1 to avoid an
		 * immediate realloc on the next call.
         */
		num_to_alloc = 1;
		(NFSv3yy_buffer_stack) = (struct NFSv3yy_buffer_state**)NFSv3yyalloc
								(num_to_alloc * sizeof(struct NFSv3yy_buffer_state*)
								);
		if ( ! (NFSv3yy_buffer_stack) )
			YY_FATAL_ERROR( "out of dynamic memory in NFSv3yyensure_buffer_stack()" );
								  
		memset((NFSv3yy_buffer_stack), 0, num_to_alloc * sizeof(struct NFSv3yy_buffer_state*));
				
		(NFSv3yy_buffer_stack_max) = num_to_alloc;
		(NFSv3yy_buffer_stack_top) = 0;
		return;
	}

	if ((NFSv3yy_buffer_stack_top) >= ((NFSv3yy_buffer_stack_max)) - 1){

		/* Increase the buffer to prepare for a possible push. */
		int grow_size = 8 /* arbitrary grow size */;

		num_to_alloc = (NFSv3yy_buffer_stack_max) + grow_size;
		(NFSv3yy_buffer_stack) = (struct NFSv3yy_buffer_state**)NFSv3yyrealloc
								((NFSv3yy_buffer_stack),
								num_to_alloc * sizeof(struct NFSv3yy_buffer_state*)
								);
		if ( ! (NFSv3yy_buffer_stack) )
			YY_FATAL_ERROR( "out of dynamic memory in NFSv3yyensure_buffer_stack()" );

		/* zero only the new slots.*/
		memset((NFSv3yy_buffer_stack) + (NFSv3yy_buffer_stack_max), 0, grow_size * sizeof(struct NFSv3yy_buffer_state*));
		(NFSv3yy_buffer_stack_max) = num_to_alloc;
	}
}

/** Setup the input buffer state to scan directly from a user-specified character buffer.
 * @param base the character buffer
 * @param size the size in bytes of the character buffer
 * 
 * @return the newly allocated buffer state object. 
 */
YY_BUFFER_STATE NFSv3yy_scan_buffer  (char * base, NFSv3yy_size_t  size )
{
	YY_BUFFER_STATE b;
    
	if ( size < 2 ||
	     base[size-2] != YY_END_OF_BUFFER_CHAR ||
	     base[size-1] != YY_END_OF_BUFFER_CHAR )
		/* They forgot to leave room for the EOB's. */
		return 0;

	b = (YY_BUFFER_STATE) NFSv3yyalloc(sizeof( struct NFSv3yy_buffer_state )  );
	if ( ! b )
		YY_FATAL_ERROR( "out of dynamic memory in NFSv3yy_scan_buffer()" );

	b->NFSv3yy_buf_size = size - 2;	/* "- 2" to take care of EOB's */
	b->NFSv3yy_buf_pos = b->NFSv3yy_ch_buf = base;
	b->NFSv3yy_is_our_buffer = 0;
	b->NFSv3yy_input_file = 0;
	b->NFSv3yy_n_chars = b->NFSv3yy_buf_size;
	b->NFSv3yy_is_interactive = 0;
	b->NFSv3yy_at_bol = 1;
	b->NFSv3yy_fill_buffer = 0;
	b->NFSv3yy_buffer_status = YY_BUFFER_NEW;

	NFSv3yy_switch_to_buffer(b  );

	return b;
}

